import React from "react";
import "./App.css";

function Robots() {
  return (
    <div className="wrapper">
      <div className="a" />
      <div className="b" />
      <div className="c" />
      <div className="d" />
      <div className="e" />
      <div className="f" />
      <div className="g" />
    </div>
  );
}

export default Robots;
